/**
 * Created by agros on 09.06.2019.
 */
import React from 'react';

const NavBar = ({toggleCreateForm}) => {
    return (
        <div className="navbarTop">
            <h1>My contacts</h1>
            <button className="btn-primary" onClick={toggleCreateForm}>
                Create contact
            </button>
        </div>
    )
};

export default NavBar;
